// PinealGland.jsx
import React from 'react';
import '../styles.css';

const PinealGland = () => {
  return (
    <div className="page multicolor-border p-4 rounded-2xl shadow-lg">
      <h1 className="text-3xl font-bold mb-4">Pineal Gland</h1>
      <p>The pineal gland is a pea-sized endocrine organ located deep in the brain, associated with regulating melatonin and circadian rhythms.</p>
      <p>Often called the “third eye,” it’s linked to spiritual vision, higher states of consciousness, and inner guidance in many cultures.</p>
      <p>It is sensitive to light, fluoride, and electromagnetic fields, and many believe detoxing the pineal gland enhances intuition and energetic awareness.</p>
    </div>
  );
};

export default PinealGland;
